import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <div className="header_container">
      <div>StackOverFlow</div>
      <span>Products</span>
      <div className="header_search">
        <span>Search</span>
      </div>
      <Link to="/Login">
        <button>Login</button>
      </Link>
      <Link to="/SignUp">
        <button>SignUp</button>
      </Link>
    </div>
  );
};

export default Header;
